import React from "react";

class SignUp extends React.Component {
  constructor() {
    super();
    this.state = {
      name: "",
      email: ""
    }
  }
  render() {
    return (
      <>
      <h1>
      Sign Up!
      </h1>
      <form>
      <label htmlFor="name"> Name </label>
      <input type="text" placeholder="Your Name" name="name" value="" id="name" />
      <br />
      <label htmlFor="name"> Email </label>
      <input type="text" placeholder="Your Email" name="email" value="" id="email" />
      </form>
      </>
    )
  }
}

export default SignUp;
